import { AppBar, Toolbar } from "@mui/material";
import LOGO from "../assets/logos/solxraf_navbar.png";

const Navbar = () => {
  return (
    <AppBar sx={{ backgroundColor: "#304FA1", px: '50px' }}>
      <Toolbar>
        <img src={LOGO} height={'50vw'} />
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
